// import logo from './logo.svg';
import '../App.css';
import {useState}from 'react';

function InsertProduct() {
  let [prodict_name,SetName]=useState()
  return (
    <div>
      
      <p>Product Name</p>
      <p><input type="text" value={prodict_name} className="form-control"/></p>
    </div>
  );
}

export default InsertProduct;
